function getSvg(svg) {
    switch (svg) {
        case 'locker open':
            return `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="512" height="512" viewBox="0 0 512 512">
            <image id="padlock_open" data-name="padlock open" width="512" height="512" xlink:href="data:image/png;base64,"/>
          </svg>`;
        case 'locker close':
            return `<svg class="locker_detail_content_toggleSvg js-toggleLocker" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="512" height="512" viewbox="0 0 512 512">

            <image id="padlock_close" data-name="padlock close" width="512" height="512" xlink:href="data:image/png;base64,"/>
        </svg>`;
        default:
            return null
    }
}